import React, { Component } from "react";
import logo from "../img/logook.jpg";
import HirdetesekComponent from "./HirdetesekComponent";
import YourComponent from "./path/of/your/component"; 

<Route path="/insert/your/path/here" component={YourComponent} />

class Header extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="header-container">
        <div className="header-row">
          <div id="logo">
            <img src={logo} alt="logo" className="header-pic" />
          </div>

          <div id="menu">
            <nav id="navbar">
              <ul className="menu-items">
                <li>Kezdolap</li>
                <li className="scrollmenu">Fajtaleirasok</li>
                <li>
                  <NavLink activeClassName="active" to="/hirdetesek">
                    Hirdetesek
                  </NavLink>
                </li>
                <li>Rolunk</li>
                <li>Kapcsolat</li>
              </ul>
            </nav>
          </div>
          <div id="right-navbar">
            <i className="fa fa-bars" aria-hidden="true"></i>
            <i className="fa fa-user" aria-hidden="true" id="userIcon"></i>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
